-- ----------------------------
DROP TABLE IF EXISTS `sys_user`;
CREATE TABLE `sys_user` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '主键id',
  `org_id` int(11) DEFAULT NULL COMMENT '组织机构id',
  `username` varchar(10) DEFAULT NULL COMMENT '用户名',
  `password` varchar(200) DEFAULT NULL COMMENT '密码',
  `email` varchar(100) DEFAULT NULL COMMENT '邮箱',
  `phone` varchar(20) DEFAULT NULL COMMENT '电话',
  `avatar` varchar(50) DEFAULT NULL COMMENT '头像',
  `status` int(11) DEFAULT '1' COMMENT '状态,1可用0不可用',
  `sort` int(11) DEFAULT NULL COMMENT '排序',
  `is_admin` int(11) DEFAULT NULL COMMENT '是否是系统管理员',
  `create_time` timestamp NULL DEFAULT NULL COMMENT '创建时间',
  `update_time` timestamp NULL DEFAULT NULL COMMENT '更新时间',
  `create_by` varchar(64) DEFAULT NULL COMMENT '创建人',
  `update_by` varchar(64) DEFAULT NULL COMMENT '更新人',
  `del_flag` int(11) DEFAULT NULL COMMENT '是否删除,1已删0未删',
  `remark` varchar(255) DEFAULT NULL COMMENT '备注',
  `tenant_id` int(11) DEFAULT '1' COMMENT '租户id',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=14 DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC COMMENT='用户表';

